require("dotenv").config();
import { MongoClient } from "mongodb";

const dbConfig = {
  useNewUrlParser: true,
  useUnifiedTopology: true,
  poolSize: 10,
  connectTimeoutMS: 2500,
};

const dbUri = process.env.DB_URI;

const initAction =
  (uri) => (config) => (db) => (collection) => async (action) => {
    const client = new MongoClient(uri, config);
    try {
      await client.connect();
      return await action(client)(db)(collection);
    } finally {
      await client.close();
    }
  };

const runAction = initAction(dbUri)(dbConfig)("test");

const findOne = (client) => (db) => async (collection) => {
  const res = await client.db(db).collection(collection).findOne({});
  return res;
};

runAction("users")(findOne).then((result) => console.log(result));

